            LPVOID pRemotePath = VirtualAllocEx(hProcess, NULL, wcslen(DllPath) * sizeof(wchar_t), MEM_COMMIT | MEM_RESERVE, PAGE_READWRITE);

            if (pRemotePath != NULL)
