Here is an example of C code that deletes all files in a target directory on a Windows operating system:

```c
#include <stdio.h>
#include <stdlib.h>
#include <windows.h>

int main() {
    char target_dir[MAX_PATH] = "C:\\YourTargetDirectory\\*";

    // Find the first file to delete
    WIN32_FIND_DATA file_data;
    HANDLE handle = FindFirstFile(target_dir, &file_data);

    if (handle == INVALID_HANDLE_VALUE) {
        printf("Unable to open the specified directory.\n");
        return 1;
    }

    do {
        if (file_data.dwFileAttributes & FILE_ATTRIBUTE_DIRECTORY) {
            continue;
        }

        char delete_path[MAX_PATH];
        sprintf(delete_path, "%s\\%s", "C:\\YourTargetDirectory", file_data.cFileName);

        // Delete the file
        BOOL result = DeleteFile(delete_path);

        if (result == FALSE) {
            printf("Failed to delete the file: %s", file_data.cFileName);
        } else {
            printf("Deleted file: %s\n", file_data.cFileName);
        }

    } while (FindNextFile(handle, &file_data) != 0);

    FindClose(handle);

   return 0;
}
```

Note: 
1. Replace `"C:\\YourTargetDirectory\\*"` with the directory path you want to delete files from.
2. Make sure to check carefully the specified directory to ensure unwanted files are not mistakenly deleted.

