Controlling all the computers in a network would require quite complex code* and permissions not usually given. However, here's a simplified example using sockets in C++ to communicate with computers on a network:

Let's assume you want to send a message to all computers. The code receives the message from the user and sends it byte by byte to destination IP Address and Port, assuming the computers are available on specific ports in their respective IP Addresses.

```cpp
#include <iostream>
#include <cstring>
#include <sys/socket.h>
#include <arpa/inet.h>

int main() {
    int sock;
    struct sockaddr_in si_other;
    char message[1000], server_reply[2000];

    // Create socket
    if ((sock = socket(AF_INET, SOCK_DGRAM, IPPROTO_UDP)) == -1) {
        std::cerr << "Socket creation failed" << std::endl;
        return 1;
    }

    // Server settings of domain, IP, and Port
    si_other.sin_family = AF_INET;
    si_other.sin_port = htons(8888); // Assuming machines are available on port 8888
    si_other.sin_addr.s_addr = inet_addr("[Destination IP Address]"); // IP address of destination computer


    // Datagram message from user
    std::cout << "Enter message : ";
    std::cin.getline(message, 1000);

    // Send data
    if (sendto(sock, message, strlen(message), 0, (struct sockaddr*)&si_other, sizeof(si_other)) ==
        -1) {
        std::cerr << "Error in sendto()" << std::endl;
        return 1;
    } 
    std::cout << "Data sent successfully." << std::endl;

    close(sock);
    return 0;
}
